@SamanthaCsik @allison_horst @brenucsb for #rstats, at least, there are ways to do very targeted searches on GitHub that are extremely fruitful

examples: limiting to a specific owner (e.g. cran or tidyverse or whatever), specific folder (e.g. R/)

