How to turn off auto-tagging/numbering in bookdown?
$$
\begin{aligned} 
y = 2x 
\end{aligned}(\#eq:1) \tag{1}
$$
produces 
$$
\begin{aligned} 
y = 2x 
\end{aligned}(\#eq:1) \tag{1}\tag{2.1}
$$
